import React from 'react'
import Header from './Header'
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <h1 className="title">Batch</h1>
      <Header />
      <BrowserRouter>
        <Routes>
          <Route path="/groups">
            <h1>Groups Page</h1>
          </Route>
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
